import { Box } from '@mui/system'
import React from 'react'

const ImageCarousel = () => {
  return (
    <Box
    sx={{
      width: 500,
      height: 900,
      backgroundColor: 'primary.dark',
      '&:hover': {
        backgroundColor: 'primary.main',
        opacity: [0.9, 0.8, 0.7],
      },
    }}
  />
  )
}

export default ImageCarousel
